        // Function to get the selected string and time remaining
        function set_string_and_time_remaining(percentage) {
            
            var strings = links[percentage]
            
            // Get the current date
            var currentDate = new Date();
            // Calculate the number of days since the reference date
            var timeDiff = currentDate.getTime() - referenceDate.getTime();
            var daysSinceReferenceDate = Math.floor(timeDiff / (1000 * 60 * 60 * 24));

            // Calculate the number of milliseconds until the next string change
            var millisecondsUntilChange = (daysSinceReferenceDate + 1) * (1000 * 60 * 60 * 24) - timeDiff;

            // Calculate hours, minutes, and seconds from milliseconds
            var seconds = Math.floor(millisecondsUntilChange / 1000);
            var minutes = Math.floor(seconds / 60);
            var hours = Math.floor(minutes / 60);
            seconds %= 60;
            minutes %= 60;

            // Choose the string based on the number of days since the reference date
            var selectedString = strings[daysSinceReferenceDate % strings.length];

            result = {
                selectedString: selectedString,
                timeRemaining: hours + ":" + (minutes < 10 ? "0" : "") + minutes + ":" + (seconds < 10 ? "0" : "") + seconds
            };
            // Display the selected string in the HTML
            document.getElementById("output_"+percentage).innerHTML = "<h1><a href='" + result.selectedString + "'>Today's " + percentage + "% Game!</a></h1>";

            // Display the time remaining until the selected string changes in HH:MM:SS format
            var countdownElement = document.getElementById("countdown");
            countdownElement.innerHTML = "<h1>Time until tommorrow's game: " + result.timeRemaining + "</h1>";

            
        }
    

        
        // Function to update the displayed values
        function updateDisplay() {
            
            var pers = ["10","20","30"];
            pers.forEach(function(per) {
                set_string_and_time_remaining(per);
            });
        }
        // Function to get a random URL
        function getRandomURL(per) {
            var randomIndex = Math.floor(Math.random() * links[per].length);
            return links[per][randomIndex];
        }

        // Function to open a random URL
        function openRandomURL(per) {
            var randomURL = getRandomURL(per);
            window.location.href = randomURL;
        }
        // Initial call to update the display
        updateDisplay();

        // Update the display every second
        setInterval(updateDisplay, 1000);

        var pers = ["10","20","30"];
        pers.forEach(function(per) {
                // Add a click event listener to the random link
            var randomLink = document.getElementById("randomLink_"+per);
            randomLink.addEventListener("click", function() {openRandomURL(per)});
        });
       
    </script>
